import React from "react";
import Form from 'react-bootstrap/Form';
import FormControl from "./FormControl";

class UserForm extends React.Component{
    constructor(props) {
        super(props);
    }

    render(){
        return(
            <Form>
                <FormControl controlId="formFirstName" label="First Name" placeholder="Enter First Name"></FormControl>
                <FormControl controlId="formLastName" label="Last Name" placeholder="Enter Last Name"></FormControl>
            </Form>
        )
    } 
}

export default UserForm;
